import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import "./App.css";
import Essentials from "./context/Essentials";
import ProjectsContext from "./context/ProjectsContext";
// COMPONENTS
import BackgroundAnimation from "./BackgroundAnimation";
import Components from "./components";
import CaseStudy from "./components/otherScreens/caseStudy";

// FUNCTIONS
function App() {
  return (
    <>
      <BackgroundAnimation />
      <>
        <Essentials>
          <ProjectsContext>
            {/* <Components />
            <CaseStudy /> */}
            <>
              <Router style={{zIndex:"9999999"}}>
                <Routes>
                  <Route exact path="/home" component={<Components />} />
                  <Route path="/Projects" component={<CaseStudy />} />
                </Routes>
              </Router>
            </>
          </ProjectsContext>
        </Essentials>
      </>
    </>
  );
}

export default App;
